import React from 'react';
import styled from 'styled-components';

import Action from './../action';

const ActionsWrapper = styled.div``;

const Actions = ({ actions }) => {
  return (
    <ActionsWrapper>
      {actions.map(action => (
        <Action action={action} />
      ))}
    </ActionsWrapper>
  );
};

export default Actions;
